import * as React from 'react';
import Box from '@mui/material/Box';
import { putProduct } from '../../features/Product/ProductSlice'
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { useDispatch } from 'react-redux';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { useParams, useNavigate } from 'react-router-dom';
import { useSelector } from 'react-redux';
import DrawIcon from '@mui/icons-material/Draw';;

const defaultTheme = createTheme();

export default function UpdateProduct(props) {
    const { id } = useParams();
    const product = useSelector((state) => state.products.currentproduct);
    const dis= useDispatch();
    let nav = useNavigate();
    const [formData, setFormData] = useState({
        name: '',
        description: '',
        content: '',
        price: '',
        imgUrl: '',
        company: '',
        prodDate: '',
        isCooling: false
      });

      useEffect(() => {

          dispatch(getProductById(id));
        
      }, [id, dispatch]);
    
      useEffect(() => {
         {
          setFormData({
            name: product.name || '',
            description: product.description || '',
            content: product.content || '',
            price: product.price || '',
            imgUrl: product.imgUrl || '',
            company: product.company || '',
            prodDate: product.prodDate || '',
            isCooling: product.isCooling || false
          });
        }
      }, [product]);
      const {
        register,
        handleSubmit,
        getValues,
        formState: { errors, dirtyFields, isValid },
      } = useForm({ mode: 'onBlur' });
      const onSubmit = (event) => {
        event.preventDefault();
        dis(putProduct({id,newProduct:formatData}))
        return (
            <ThemeProvider theme={defaultTheme}>
              <Grid container component="main" sx={{ height: '50vh', width: '60vw', marginLeft: '20vw' }}>
                <CssBaseline />
                <Grid
                  item
                  xs={false}
                  sm={4}
                  md={7}
                  sx={{
                    backgroundImage: `url(${!add && product ? product.imgUrl : 'https://gregcafe.co.il/wp-content/uploads/2023/03/%D7%92%D7%91%D7%A2%D7%AA-%D7%A9%D7%9E%D7%95%D7%90%D7%9C-1.jpg'})`,
                    backgroundRepeat: 'no-repeat',
                    backgroundColor: (t) =>
                      t.palette.mode === 'light' ? t.palette.grey[50] : t.palette.grey[900],
                    backgroundSize: 'cover',
                    backgroundPosition: 'center',
                  }}
                />
                <Grid item xs={12} sm={8} md={5} component={Paper} elevation={6} square>
                  <Box
                    sx={{
                      my: 8,
                      mx: 4,
                      display: 'flex',
                      flexDirection: 'column',
                      alignItems: 'center',
                    }}
                  >
                    <Typography component="h1" variant="h5">
                      {buttonName} Product
                    </Typography>
                    <Box component="form" onSubmit={(e) => handleSubmit(onSubmit(e))} sx={{ mt: 1 }}>
                      <TextField
                        margin="normal"
                        required
                        fullWidth
                        id="name"
                        label="Name"
                        name="name"
                        autoComplete="name"
                        value={formData.name}
                        onChange={handleChange}
                        autoFocus
                      />
                      <TextField
                        margin="normal"
                        required
                        fullWidth
                        id="description"
                        label="Description"
                        name="description"
                        autoComplete="description"
                        value={formData.description}
                        onChange={handleChange}
                      />
 
                      <TextField
                        margin="normal"
                        type='number'
                        required
                        fullWidth
                        id="price"
                        label="Price"
                        name="price"
                        autoComplete="price"
                        value={formData.price}
                        onChange={handleChange}
        
                      />
                    
                    
                      <TextField
                        margin="normal"
                        required
                        fullWidth
                        id="imgUrl"
                        label="Image URL"
                        name="imgUrl"
                        autoComplete="imgUrl"
                        value={formData.imgUrl}
                        onChange={handleChange}
        
                      />
            
                      <Button
                        type="submit"
                        fullWidth
                        variant="contained"
                        sx={{ mt: 3, mb: 2 }}
        
                      >
                        {buttonName}
                      </Button>
                    </Box>
                  </Box>
                </Grid>
              </Grid>
            </ThemeProvider>
          );
        }}
